import './App.css';
import 'bootstrap/dist/css/bootstrap.min.css';
import { Component } from 'react';
import { Button } from 'reactstrap';

class App extends Component {
  constructor(props) {

    super(props);
    this.state = {
      contador:0,
      colores:Array(5).fill("secondary"),
      memoria : [],
    };
  }

  render() {
    return (
      <div className="App">
        <header className="App-header">
          <div>
            {this.state.contador}
          </div>
          <div>
            Botoncillo
          </div>
        </header>
      </div>
    );
  }
}

function Botoncillo(props) {
  return(
    <Button color={props.color} onClick={props.accionBtn}></Button>
  );
}

export default App;
